import React from "react";
import AccommodationTerm from "../AccommodationTerm/accommodationTerm";
import {Link} from "react-router-dom";

const accommodations = (props) => {
    return(
        <div className={"container mm-4 mt-5"}>
            <div className={"row"}>
                <div className={"row"}>
                    <table className={"table table-striped"}>
                        <thead>
                        <tr>
                            <th scope={"col"} style={{ maxWidth: '200px' }}>Name</th>
                            <th scope={"col"}>Category</th>
                            <th scope={"col"}>Host</th>
                            <th scope={"col"}>Number of rooms</th>
                            <th scope={"col"}>Rented</th>
                        </tr>
                        </thead>
                        <tbody>
                        {props.accommodations?.map((t) => {
                            return(
                                <AccommodationTerm term={t} onDelete={props.onDelete}/>
                            );
                        })}
                        </tbody>
                    </table>
                </div>
                <div className="col mb-3">
                    <div className="row">
                        <div className="col-sm-12 col-md-12">
                            <Link className={"btn btn-block btn-dark"} to={"/products/add"}>Add new product</Link>
                        </div>
                    </div>
                </div>
            </div>
        </div>

    );
}

export default accommodations;
